import React from 'react';

interface VideoPlayerProps {
  onEnded: () => void;
  isPlaying: boolean;
  setIsPlaying: (playing: boolean) => void;
}

const VideoPlayer: React.FC<VideoPlayerProps> = ({ onEnded, isPlaying, setIsPlaying }) => {
  return (
    <div>
      <video
        src="URL_DO_SEU_VIDEO" // Substitua pela URL do seu vídeo
        onEnded={onEnded}
        controls
        onPlay={() => setIsPlaying(true)}
        onPause={() => setIsPlaying(false)}
      />
    </div>
  );
};

export default VideoPlayer;
